import './Card.css';
import { NavLink } from 'react-router-dom'

export default function Card({ id, name, image, temperament, weight }) {
    return (
        <div className="upperDiv">
            <NavLink to={`/dogs/${id}`}><h2 className="nameDog">{name}</h2></NavLink>
            <div className="imgCard">
                <img src={image} alt="This is a Dog" className="image" />
                <div className="divTW">
                    <div className="divWeight">Weight: {weight}</div>
                    <div className="divTemps">Temperament: {temperament}</div>
                </div>
            </div>
        </div>
    )
}
